import './popularPosts.css';

const popularPosts = (props) => {
    const posts = [...props.posts];
    return ( 
        <div className={'popularPosts'}>
            {props.posts.map(post => post.popularity === 'popular' ? <sidePost  posts={props.posts} /> : null )}
        </div>
     );
}

export default popularPosts;
